import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavigationBar from './Components/NavbarComponent';
import Introduction from './Components/IntroductionComponent';
import Education from './Components/EducationComponent';
import { INTRODUCTION } from './assets/data/introduction';
import { EDUCATION } from './assets/data/education';
import arslan from './assets/images/arslan.jpg';


class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      intro: INTRODUCTION,
      education: EDUCATION
    };
  }

  render() {
    return (
      <div>

        <NavigationBar/>

        <div className="container">
          <div className="row mt-5">
            <div className="col-4">
               <img width="80%" height="82%" src={arslan} alt="arslan pic"className="rounded" />
            </div>
            <div className="col-8 " >

            <div id="intro">
              <Introduction intro = {this.state.intro}/>
            </div>        

              <div id="education">
                <Education education = {this.state.education}/>
              </div>       

            </div>
          </div>
        </div>


      </div>

    );
  }
}

export default App;
